import React from 'react'
import NoteSearchBar from './NoteSearchBar'
import NewNoteButton from './NewNoteButton'
import NoteList from './NoteList'
import { GoogleLogin } from 'react-google-login'
import axios from 'axios'

const responseGoogleSucess = async (respose) => {
    try {
        const result = await axios({
            method: 'post',
            url: 'http://localhost:4000/googlelogin',
            data: { tokenId: respose.tokenId }
        });
        console.log(result); //DELETE ME
    }catch(error){
        console.log(error); //DELETE ME
    }
}

const responseGoogleFailure = (respose) => {
    console.log(respose);
}

class Notes extends React.Component{
    render(){
        return (
            <div name="note">
                <h1>This is a Note page!!</h1>
                <GoogleLogin
                    clientId={process.env.CLIENT_ID}
                    buttonText="Login with google"
                    onSuccess={this.responseGoogleSuccess}
                    onFailure={this.responseGoogleFailure}
                    cookiePolicy={'single_host_origin'}
                />
                <NoteSearchBar />
                <NewNoteButton />
                <NoteList />
            </div>
        )
    }
}

export default Notes
